import {Input, FormLabel, FormControl, Flex} from "@chakra-ui/react";

const InputField = (props) => {

  const inputDigit = (e) => {
    props.inputChange(e.target.value);
    console.log(e.target.value)
  }

  return(
    <Flex justify="space-between" align="center" gap="10px">
      <FormControl h="100vh" align="center" justify="center" bg="#333">
        <FormLabel color="#fff">
            {props.label}
          </FormLabel>
          <Input bg="#333" color="#fff" border="1px solid #fff" padding="8px" borderRadius="8px" outline="none" fontSize="16px"
            required={props.required}
            type={props.type}
            value={props.value}
            onChange={inputDigit}
          />
      </FormControl>
    </Flex>
  );
}

export default InputField;
